import { Box, styled, Typography, Grid, Paper, List, ListItem } from "@mui/material";
import React from "react";





const Future = () => {

  return (
    <Box sx={{ maxWidth: "1300px", mx: "auto", my: 12 }} id="Future">
    <Typography
      variant="h3"
      sx={{ color: "rgba(255, 247, 0, 0.8)" , textAlign: "center", mb: 2 }}
    >
      Development plans
    </Typography>
    </Box>




  );
};

export default Future;
